import styled from "../assets/styles";


export const Header = styled.header`
    h1 {
        position: absolute;
width: 190px;
height: 58px;

font-family: Montserrat;
font-style: normal;
font-weight: 800;
font-size: 48px;
line-height: 59px;
text-align: center;

color: #88DEAF;


    }
    h3 {
        color: white;
    }

`
